query eventPerson($eventId: ID!, $filters: [EventPersonFilter!]) {
  eventPerson(eventId: $eventId, filters: $filters) {
    nodes {
      createdAt
      firstName
      id
      lastName
      jobTitle
      organization
      userId
      address {
        city
      }
      email
      photoUrl
      socialNetworks {
        profile
        type
      }
      updatedAt
    }
  }
}
